import Card from './components/Card';
import Wrapper from './components/Wrapper';

function App() {
  const cardData = [
    { title: 'product1', description: 'description1' },
    { title: 'product2', description: 'description2' },
    { title: 'product3', description: 'description3' },
  ];

  return (
    <Wrapper>
      {/* <Card
        title='produkt1'
        description='deskripcija1'
      ></Card> */}

      {cardData.map((data) => (
        <Card key={data.id} title={data.title} ></Card>
      ))}
    </Wrapper>
  );
}

export default App;
